import React from 'react';
import { Drawer, List, ListItem } from '@mui/material';

const SideDrawer = (props) => {
  const links = [
    { where: '', value: 'To Top' },
    { where: '', value: 'To Top' },
    { where: '', value: 'To Top' },
    { where: '', value: 'To Top' },
    { where: '', value: 'To Top' },
  ];
  return (
    <Drawer
      anchor={'right'}
      open={props.open}
      onClose={() => props.onClose(false)}
    >
      <List component='nav'>
        <ListItem button onClick={() => alert('click')}>
          Name of Items
        </ListItem>
      </List>
    </Drawer>
  );
};

export default SideDrawer;
